import React, { useRef } from 'react'
import Togglable from './Togglable'

const blogDetailsRef = useRef()

const blogDetails = () => (
  <Togglable buttonLabel="View" ref={blogDetailsRef}>
    <div>coucso</div>
  </Togglable>
)

const Blog = ({ blog }) => {
  return (
    <div>
      {blog.title} {blog.author}
      {blogDetails()}
    </div>
  )
}

export default Blog
